  <div class="base">
    <ul>
      <li>Adelaide</li>
      <li>Melbourne</li>
      <li>Sydney</li>
    </ul>
    <div id="replaced">Mozilla</div>
    <div id="replaced2">Mozilla2</div>
  </div>
